#!usr/bin/env python3

dna = ''

dna_lower=dna.lower()

A_count = dna_lower.count('a')
G_count = dna_lower.count('g')
T_count = dna_lower.count('t')
C_count = dna_lower.count('c')

AT_content = round((A_count+T_count)/len(dna),2)
GC_content = round((G_count+C_count)/len(dna),2)

print('The AT content of this sequence is: {}. The GC content is {}.'.format(AT_content, GC_content))
